window.bookSummaryJSON = "<p><b>Audie Award Nominee, Paranormal, 2013</b></p> <p>Teenage delinquent Angel Crawford lives with her redneck father in the swamps of southern Louisiana. She's a high school dropout, addicted to drugs and alcohol, and has a police record a mile long. But when she's made into a zombie after a car crash, her addictions disappear, except for her all-consuming need to stay \"alive\".</p>"; 
